# Создаем объект BeautifulSoup для парсинга HTML.
# 'lxml' — это быстрый и надёжный парсер.
soup = BeautifulSoup(html_doc, 'lxml')

# Находим все родительские div'ы для каждой карточки модели.
# У каждой карточки есть класс 'yagpt-model-market-item'.
model_cards = soup.find_all('div', class_='yagpt-model-market-item')

# Проходимся циклом по каждой найденной карточке
for card in model_cards:
    # Ищем заголовок внутри карточки.
    # Он находится в теге <span> с классом 'yagpt-model-market-item__model-label'.
    heading_tag = card.find('span', class_='yagpt-model-market-item__model-label')
    # Проверяем, что тег найден, чтобы избежать ошибок
    heading = heading_tag.text.strip() if heading_tag else "Заголовок не найден"

    # Ищем описание.
    # Оно находится в теге <span> с классом 'yagpt-model-market-item__description'.
    description_tag = card.find('span', class_='yagpt-model-market-item__description')
    # Используем .get_text(strip=True), чтобы получить чистый текст из всех вложенных тегов (например, <p>)
    description = description_tag.get_text(strip=True) if description_tag else "Описание не найдено"

    # Выводим результат в виде ненумерованного списка
    print(f"* {heading}")
    print(f"  {description}\n")

